import React from "react";
import ReactAnimatedWeather from "react-animated-weather";

export default function MainImage(props) {
  let icon = [
    "CLEAR_DAY",
    "CLEAR_NIGHT",
    "PARTLY_CLOUDY_DAY",
    "PARTLY_CLOUDY_NIGHT",
    "CLOUDY",
    "RAIN",
    "SLEET",
    "SNOW",
    "WIND",
    "FOG",
  ];

  return (
    <ReactAnimatedWeather
      icon={icon[0]}
      color="black"
      size={110}
      animate={true}
    />
  );
}
